import React from 'react';

function App() {
  return (
    <div style={{ padding: '2rem', fontFamily: 'Arial', fontSize: '1.2rem' }}>
      <h1>Welcome to CareCompanion AI</h1>
      <p>This app helps seniors navigate healthcare options with ease.</p>
      <button style={{ padding: '10px 20px', fontSize: '1rem' }}>Get Started</button>
    </div>
  );
}

export default App;
